import React from 'react';

const About = () => {
  return (
    <div className="container mt-5 text-center">
        <div className='offset-md-3 col-md-6 col-sm-12'>
        <h1 class="lead">
        <span class="text-primary fw-bold">WeatherWear</span>, your handy weather API.
        </h1>
        <p>
          Welcome to our website! This is the About page where you can learn more about our company or project.
        </p>
        <img src="../ll_placeholder.png" class="my-1 img-fluid center rounded" alt="placeholder" height="60%" width="60%"></img>
        <button class="my-3 btn btn-primary center" href='/'>Sign up & start surveying</button>
        </div>
    </div>
  );
};

export default About;
